import React, { Component } from "react";
import Form from "../form/Form";
import Button from "../button/Button";
import { withRouter } from "react-router-dom";

const Tokens = (props) => {
  const clk = () => {
    props.history.push({
      pathname: "/api/showdata",
      ugugdul: "tokens",
    });
  };
  return (
    <div className="pagez">
      <h1>Токеноор</h1>
      <div className="form_holder">
        <Form placeholder="amount" id="1" />
        {/* <Form placeholder="checksum" id="2" /> */}
        <Form placeholder="transactionId" id="3" />
        {/* <Form placeholder="lang" id="4" /> */}
        <Form
          placeholder="token"
          id="2"
          value="2d38f609c868c1b5f94b2320a9a9244897e0cf8176a01ec802e99ed418c3f97b"
        />
      </div>
      <Button onclk={clk} whichcomp="tokens"></Button>
    </div>
  );
};

export default withRouter(Tokens);
